import React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import Tab from './tabs';
import Model from './model';
import ROSLIB from 'roslib';

var ros = new ROSLIB.Ros({
    url : 'ws://localhost:9090'
});

// status
ros.on('connection', function() {
    console.log("Connected");
});

ros.on('error', function(error) {
    console.log("Error");
});

ros.on('close', function() {
    console.log("Closed");
});

const Home = () => {
    // subscriber
    var pressure = new ROSLIB.Topic({
        ros : ros,
        name : '/pressure',
        messageType : 'std_msgs/Float32'
    });
    pressure.subscribe(function(m) {
        document.getElementById("prs").innerHTML = m.data.toString();
    });

    var yaw = new ROSLIB.Topic({
        ros : ros,
        name : '/yaw',
        messageType : 'std_msgs/Float32'
    });
    yaw.subscribe(function(m) {
        document.getElementById("yaw").innerHTML = m.data.toString();
    });

    var pitch = new ROSLIB.Topic({
        ros : ros,
        name : '/pitch',
        messageType : 'std_msgs/Float32'
    });
    pitch.subscribe(function(m) {
        document.getElementById("pitch").innerHTML = m.data.toString();
    });

    var roll = new ROSLIB.Topic({
        ros : ros,
        name : '/roll',
        messageType : 'std_msgs/Float32'
    });
    roll.subscribe(function(m) {
        document.getElementById("roll").innerHTML = m.data.toString();
    });

    return(
        <Grid container spacing={2}>
            <Grid item xs={6}>
               <Tab />
            </Grid>

            <Grid item xs={6}>
                <Grid container rowSpacing={2} columnSpacing={2}>
                    <Grid item xs={6}>
                        <Card className='card'>
                        <CardContent>
                            <Typography variant='h5' color={'white'}>
                            Pressure
                            </Typography>
                            <Typography variant='h7' id="prs"></Typography>
                        </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={6}>
                        <Card>
                        <CardContent>
                            <Typography variant='h5'>
                            Yaw
                            </Typography>
                            <Typography variant='h7' id="yaw"></Typography>
                        </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={6}>
                        <Card>
                        <CardContent>
                            <Typography variant='h5'>
                            Pitch
                            </Typography>
                            <Typography variant='h7' id="pitch"> </Typography>
                        </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={6}>
                        <Card>
                        <CardContent>
                            <Typography variant='h5'>
                            Roll
                            </Typography>
                            <Typography variant='h7' id="roll"></Typography>
                        </CardContent>
                        </Card>
                    </Grid>

                    <Grid item xs={12}>
                        <Model />
                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    );
}

export default Home;
